        dup23 = 2*CB*MW*SW*USfC(Sfe3,2,2,gno1)*ZNeuC(Neu3,1) + 
     &    CW*Mf(2,gno1)*USfC(Sfe3,1,2,gno1)*ZNeuC(Neu3,3)

        dZfR1(2,gno1,gno2) = 
     &   dZfR1(2,gno1,gno2) + 
     &    1/(8.D0*Pi)*(AlfaMZ*
     &        (dup22*dup23*
     &           Re(B1(Mf2(2,gno1),MNeu2(Neu3),MSf2(Sfe3,2,gno1)))+
     &            CB*MW*Mf(2,gno1)*
     &           (MNeu(Neu3)*
     &              Re(DB0(Mf2(2,gno1),MNeu2(Neu3),
     &                MSf2(Sfe3,2,gno1)))*
     &              (dup22*USfC(Sfe3,1,2,gno1)*
     &                 (SW*ZNeu(Neu3,1) + CW*ZNeu(Neu3,2)) + 
     &                dup23*USf(Sfe3,1,2,gno1)*
     &                 (SW*ZNeuC(Neu3,1) + CW*ZNeuC(Neu3,2))) + 
     &             Mf2(2,gno1)*
     &              Re(DB1(Mf2(2,gno1),MNeu2(Neu3),
     &                MSf2(Sfe3,2,gno1)))*
     &              (USf(Sfe3,1,2,gno1)*USfC(Sfe3,2,2,gno1)*
     &                 ZNeu(Neu3,3)*
     &                 (CW*SW*ZNeuC(Neu3,1) - CW2*ZNeuC(Neu3,2)) + 
     &                USf(Sfe3,2,2,gno1)*USfC(Sfe3,1,2,gno1)*
     &                 (CW*SW*ZNeu(Neu3,1) - CW2*ZNeu(Neu3,2))*
     &                 ZNeuC(Neu3,3))) + 
     &          Mf2(2,gno1)*
     &           (-(CW*MNeu(Neu3)*
     &                Re(DB0(Mf2(2,gno1),MNeu2(Neu3),
     &                  MSf2(Sfe3,2,gno1)))*
     &                (dup22*USfC(Sfe3,2,2,gno1)*ZNeu(Neu3,3) + 
     &                  dup23*USf(Sfe3,2,2,gno1)*ZNeuC(Neu3,3))) + 
     &             Re(DB1(Mf2(2,gno1),MNeu2(Neu3),
     &                MSf2(Sfe3,2,gno1)))*
     &              (CB2*MW2*
     &                 (4*SW2*USf2(Sfe3,2,2,gno1)*ZNeu(Neu3,1)*
     &                    ZNeuC(Neu3,1) + 
     &                   USf2(Sfe3,1,2,gno1)*
     &                    ((SW2*ZNeu(Neu3,1) + CW*SW*ZNeu(Neu3,2))*
     &                       ZNeuC(Neu3,1) + 
     &                      (CW*SW*ZNeu(Neu3,1) + 
     &                      CW2*ZNeu(Neu3,2))*ZNeuC(Neu3,2))) + 
     &                CW2*Mf2(2,gno1)*
     &                 (USf2(Sfe3,1,2,gno1) + USf2(Sfe3,2,2,gno1))*
     &                 ZNeu(Neu3,3)*ZNeuC(Neu3,3)))))/
     &      (CB2*CW2*MW2*SW2)

	ENDLOOP(Neu3)
	ENDLOOP(Sfe3)

	else

	dZfR1(2,gno1,gno2) = 0

	endif

#ifdef DETAILED_DEBUG
	DCOUP "dZfR1(2,gno1,gno2) =", dZfR1(2,gno1,gno2) ENDL
#endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end
